import React from "react";
import Spritesheet from "react-responsive-spritesheet";

interface CharProps {}

const charComponent: React.FC<CharProps> = (props) => {
  return (
    <div>
      <h1>Char</h1>
      <Spritesheet
        image={`http://www.example.com/assets/image.png`}
        widthFrame={800}
        heightFrame={648}
        steps={46}
        fps={12}
      />
    </div>
  );
};

export default charComponent;
